import React from 'react'
import { Link, useParams } from 'react-router-dom'

export default function EventDetailPage() {
    const params = useParams();

  return (
    <>
        <h1>Event Detail</h1>
        <p>Event ID: {params.eventId}</p>
        <p><Link to="..">Back</Link></p>
    </>
  )
}
